              'id' => 115721182,
              'value' => 'Xiaomi',
              'info' => 'Xiaomi стремится быть другом для своих пользователей и оставаться лучшей для них. Компания остается верна своей цели развивать инновации, оставляя главным приоритетом качество и эффективность. Миссия Xiaomi состоит в постоянном стремлении создавать отличные продукты по справедливым ценам, чтобы жизнь каждого становилась лучше благодаря инновационным технологиям.<br>В 2019 году основатель Xiaomi Лэй Цзюнь дал клятву, что чистая прибыль со всех аппаратных устройств компании не будет превышать 5%. Это является конкретным подтверждением слов о том, что цель Xiaomi – не в том, чтобы занять крупную долю на рынке и извлечь максимум прибыли, а обеспечить, чтобы каждый смог позволить себе инновационные продукты 21 века. <br><br>Достижения<br><br>Сейчас Xiaomi является четвертым по величине производителем смартфонов в мире. Компания также создала ведущую в мире платформу потребительского Интернета вещей, к которой подключено 271 миллион интеллектуальных устройств, не считая смартфонов и ноутбуков. Продукция Xiaomi представлена в более чем 90 странах мира.<br>В августе 2020 года Xiaomi во второй раз вошла в список Fortune Global 500, заняв 422-е место, поднявшись на 46 позиций по сравнению с предыдущим годом (7-е место среди интернет-компаний в списке). В мае 2020 года компания снова вошла в список Forbes Global 2000 (поднявшись до 384-го места в рейтинге). Xiaomi также представлена в Hang Seng Index, Hang Seng China Enterprises Index и Hang Seng TECH Index. ',
